zh:
{'name': 'Koteswara Rao Vellanki', 'bio': "I am an experienced DevOps Engineer currently working at UST, with over five years in the IT industry. My previous positions were with HCL Technologies and Agathsya Technologies, where I honed my skills in various DevOps tools and techniques, particularly in containerization and orchestration technologies. I completed a Master's degree in Computer Applications from Acharya Nagarjuna University, graduating with distinction.

I am passionate about using my technical skills to solve complex problems, streamlining operations to enhance business outcomes. My ability to quickly learn and adapt has made me a key player in every team I've been part of, often going the extra mile to ensure projects succeed.

Beyond my professional work, I am actively involved in the Python community. I serve as a community organizer for PyCon India and have volunteered at several international PyCon events, including in the Philippines, across the Asia-Pacific region, and in the United States. This involvement in the community is driven by my commitment to sharing knowledge and helping others grow in the field."}

