{'name': 'Po Han, Huang', 'bio': 'The Kubernetes CIS Benchmark is a critical framework designed to safeguard Kubernetes ecosystems through a series of security guidelines. NeuVector CIS benchmarking is a dynamic, Golang-driven process that tailored shell scripts based on the specificities of operating systems and Kubernetes versions. NeuVector will run the customized shell scripts with GoLang, culminating the result into a detailed UI report.

During deployment on Bottlerocket environments, NeuVector encountered unexpected shell command issues. Various attempted fixes, including adding path variables to cover command paths and linking the C runtime using ldd, proved ineffective. It transpired that the built-in C runtime differed from that of Bottlerocket, leading to symbolic link discrepancies and subsequent failures. Initially perceived as minor, these issues unveiled significant systemic challenges within the existing CIS benchmark workflow. This experience prompted a thorough investigation into underlying problems, resulting in valuable workflow enhancements.

This presentation not only elucidates the analytical process and resulting resolutions but also delves into ongoing development and optimization efforts.'}

zh:
{'name': 'Winlin Yang', 'bio': 'Winlin is an accomplished software engineer and a distinguished leader in open-source projects, with an impressive track record of over 10+ years in video streaming and cloud industries. His expertise includes cloud service of RTC, new use scenarios of rich media, and the development of the widely used open source project, SRS (Simple Realtime Server).
 
Winlin works in Tencent Cloud, delivering innovative, low-latency interactive live streaming solutions for group audio/video calls. Before his current role, he worked at ChinaCache, successfully developing the live-streaming CDN server. He also built the WebRTC cloud service from scratch in Alibaba Cloud.
 
People widely recognize Winlin as the founder and driving force behind the success of the SRS (Simple Realtime Server) project. This powerful real-time video gateway server has been valued and widely used globally. With his expertise and leadership, he is truly impacting the world of video streaming and cloud technologies.'}

