zh:
{'name': 'Mark Overmeer', 'bio': 'Mark started to program in 1978, and has not stopped since.  He received his MSc in Computing Science on real-time fault tolerant systems.  He spent six years as system programmer in the super-computer center of the (Dutch) National Aerospace Laboratories.    Followed by six years as trainer UNIX/Linux/C/networking for professionals   Meanwhile, he developed the 10th Dutch website (in existence).  In 2002, the Open Source development projects grew too heavy, which made him decide to become self-employed.

In the past 20 years, Mark produced many large Open Source libraries, mainly in email- and XML processing, but also worked for companies in a wide variation of projects.  One of his consistent customers is the NCSC, the Dutch National Cyber Security Center of the Ministry of Justice.

Mark has deep understanding of software development and maintenance, operating systems, protocols, and network infrastructure.'}

