zh:
{'name': '李慕約', 'bio': '李慕約是 Generative AI 社群 ( gaiconf.com ) 的主辦人，這是一個致力於推廣生成式 AI 的社群。

李慕約同時也是李慕約公司（muyueh.com）的負責人，這家公司提供資料視覺化、大數據分析等服務，客戶包括中華電信、遠傳電信、玉山銀行等企業，

李慕約過去曾任 COSUCP 2014、2015、2016 的講者，講述開放資料以及資料視覺化的主題。'}

en:
{'name': '李慕約', 'bio': 'Lee is the organizer of the Generative AI Community (https://gaiconf.com/), a community dedicated to promoting generative AI.

Lee is also the head of Muyueh Inc. (muyueh.com), a company that provides data visualization and big data analysis services. Their clients include major companies like Chunghwa Telecom, Far EasTone Telecommunications, and E.SUN Bank.

In the past, Lee has been a speaker at COSUCP in 2014, 2015, and 2016, discussing topics related to open data and data visualization.'}

