{'name': 'Jay Chang', 'bio': 'I am a Computer Science and Engineering major at Yuan Ze University, also enrolled in the interdisciplinary Artificial Intelligence and Bioinformatics Program. This combination allows me to gain expertise in my core field while exploring its applications in cutting-edge areas. Recently, I served as a Teaching Assistant for the MY Camp 2024 (MIT x YZU Collaboration Program), an experience that has enriched my academic journey.

Beyond my formal coursework, I am dedicated to continuous learning and actively seek opportunities to expand my knowledge and skills. I regularly utilize online resources and open courseware from various universities to deepen my understanding of computer science and related fields.

I am committed to continuously improving my academic and professional abilities, always seeking new challenges and learning opportunities in the rapidly evolving world of computer science and its interdisciplinary applications.'}
